</ul>
<p>Visit the <a href="https://woocommerce.com/document/server-requirements/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6" rel="nofollow ugc">WooCommerce server requirements documentation</a> for a detailed list of server requirements.</p>
<h4>Automaatne paigaldus</h4>
<p>Automatic installation is the easiest option &#8212; WordPress will handle the file transfer, and you won‚Äôt need to leave your web browser. To do an automatic install of WooCommerce, log in to your WordPress dashboard, navigate to the Plugins menu, and click ‚ÄúAdd New.‚Äù</p>
<p>In the search field type ‚ÄúWooCommerce,‚Äù then click ‚ÄúSearch Plugins.‚Äù Once you‚Äôve found us,  you can view details about it such as the point release, rating, and description. Most importantly of course, you can install it by! Click ‚ÄúInstall Now,‚Äù and WordPress will take it from there.</p>
<h4>K√§sitsi paigaldamine</h4>
<p>K√§sitsi paigaldus t√§hendab WooCommerce plugina allalaadimist ning seej√§rel selle √ºleslaadimist oma veebiserverisse oma eelistatuima FTP rakendusega. WordPressi koodeksis on <a href="https://wordpress.org/support/article/managing-plugins/#manual-plugin-installation" rel="ugc">instruktsioonid, kuidas seda teha</a>.</p>
<h4>Uuendamine</h4>
<p>Automatic updates should work smoothly, but we still recommend you back up your site.</p>
<p>Kui juhuslikult peaks esinema probleeme poe/kategooriate lehtedega peale uuendamist, tuleb v√§rskendada p√ºsiviiteid. Normaalse olukorra taastamiseks mine WordPress &gt; S√§tted &gt; P√ºsiviited ja vajuta &#8220;salvesta&#8221;.</p>
<h4>N√§idisandmed</h4>
<p>WooCommerce comes with some sample data you can use to see how products look; import sample_products.xml via the <a href="https://wordpress.org/plugins/wordpress-importer/" rel="ugc">WordPress importer</a>. You can also use the core <a href="https://woocommerce.com/document/product-csv-importer-exporter/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6" rel="nofollow ugc">CSV importer</a> or our <a href="https://woocommerce.com/products/product-csv-import-suite/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6" rel="nofollow ugc">CSV Import Suite extension</a> to import sample_products.csv</p>
