		</div>
	</div>
	<div class="review-body"><!-- wp:paragraph -->
<p>There is a reason why shopify has taken so much market share. Woo just feels so clunky in every aspect. even basic things to run an ecommerce store in 2024 need extra plugins (e.g new account email validation, default tax rates, order email designer, a decent product bulk edit, checkout customizer, order bump, filters &amp; sorting, bulk discounts...)<br />Development for woo feels so stagnant and there hasn't been any innovative features in a looong time. <br />The fact that I don't even have a dashboard where I can see the conversion rate and all important metrics for my store is just mind blowing. the current analytics is a bit of a joke. </p>
<!-- /wp:paragraph --></div>
